"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[2728],{18936:(a,e,o)=>{o.r(e),o.d(e,{data:()=>r});const r=JSON.parse('{"key":"v-4264aa4b","path":"/docs/verticals/education-management/import-contracts-education.html","title":"Carga de Contratos Masiva (Educación)","lang":"es-ES","frontmatter":{"title":"Carga de Contratos Masiva (Educación)","category":["Documentation"],"star":9,"sticky":9,"tag":["Educación"],"article":false,"summary":"Carga Masiva de Alumno-Contrato (Educación) Esta funcionalidad permite crear registros de nuevos alumnos realizando la carga de sus entidades relacionadas en una misma importación.","head":[["meta",{"property":"og:url","content":"https://ayuda.solopapp.com/docs/verticals/education-management/import-contracts-education.html"}],["meta",{"property":"og:title","content":"Carga de Contratos Masiva (Educación)"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2023-12-11T19:48:18.000Z"}],["meta",{"property":"og:locale","content":"es-ES"}],["meta",{"property":"article:tag","content":"Educación"}],["meta",{"property":"article:modified_time","content":"2023-12-11T19:48:18.000Z"}]]},"excerpt":"","headers":[{"level":2,"title":"Carga Masiva de Alumno-Contrato (Educación)","slug":"carga-masiva-de-alumno-contrato-educacion","children":[{"level":3,"title":"1. Formato de Importación de Datos","slug":"_1-formato-de-importacion-de-datos","children":[]},{"level":3,"title":"2. Cargador de Archivo","slug":"_2-cargador-de-archivo","children":[]},{"level":3,"title":"3. Importar Contrato","slug":"_3-importar-contrato","children":[]},{"level":3,"title":"4. Consejos útiles","slug":"_4-consejos-utiles","children":[]},{"level":3,"title":"5. Ejemplo de Carga de Archivo Alumno-Contrato","slug":"_5-ejemplo-de-carga-de-archivo-alumno-contrato","children":[]}]}],"git":{"createdTime":1702324098000,"updatedTime":1702324098000,"contributors":[{"name":"mgarciaQ76","email":"139590879+mgarciaQ76@users.noreply.github.com","commits":1}]},"readingTime":{"minutes":1.89,"words":567},"filePathRelative":"docs/verticals/education-management/import-contracts-education.md","localizedDate":"11 de diciembre de 2023"}')},42939:(a,e,o)=>{o.r(e),o.d(e,{default:()=>s});var r=o(53633);const t=[(0,r.Fv)('<h2 id="carga-masiva-de-alumno-contrato-educacion" tabindex="-1"><a class="header-anchor" href="#carga-masiva-de-alumno-contrato-educacion" aria-hidden="true">#</a> Carga Masiva de Alumno-Contrato (Educación)</h2><p>Esta funcionalidad permite crear registros de nuevos alumnos realizando la carga de sus entidades relacionadas en una misma importación.</p><p>Desde una planilla con datos concatenados se importan las siguientes entidades: Alumno (y su localización), familiares (padre, madre, hasta tres parientes), la entidad familia (con sus miembros) y el Contrato de Servicio vinculado al alumno.</p><h3 id="_1-formato-de-importacion-de-datos" tabindex="-1"><a class="header-anchor" href="#_1-formato-de-importacion-de-datos" aria-hidden="true">#</a> 1. Formato de Importación de Datos</h3><p>Este circuito se inicia creando el formato de importación de datos correspondiente a Contratos.</p><p><img src="/assets/img/docs/basic-rules/bid-format.png" alt="Formato de importación"></p><p>Dentro de este formato se configuran los campos correspondientes para asegurar la correcta carga de los datos al generar la importación.</p><p><img src="/assets/img/docs/basic-rules/bid-fields.png" alt="Campos de Fomato"></p><p>Estos datos estarán separados por secciones: Socio del Negocio Estudiante (y su localización), Socio de Negocio responsable de pago (padre, madre, etc.), entidad Familia, entidad Contrato y Contactos (hasta tres contactos, siendo el contacto número uno el responsable de pago por defecto).</p><h3 id="_2-cargador-de-archivo" tabindex="-1"><a class="header-anchor" href="#_2-cargador-de-archivo" aria-hidden="true">#</a> 2. Cargador de Archivo</h3><p>Una vez seteado el formato de importación con los campos necesarios para realizar la carga masiva, desde la ventana Cargador de Archivo se realizará la subida de la planilla generada (con los datos concatenados en forma cronológica y de acuerdo al formato de importación creado.</p><p>Se debe seleccionar formato de importación: Importar Contratos. Luego elegir set de caracteres UTF-8 o UTF-16.</p><p>Desde el botón de acción &quot;Seleccionar Archivo a Cargar&quot; se habilitará una ventana emergente con la opción de &quot;choose file&quot; para seleccionar el archivo (planilla) a cargar y luego la opción de &quot;Cargar Archivo (upload)&quot;.</p><p><img src="/assets/img/docs/basic-rules/bid-upload2.png" alt="Ventana emergente"></p><p>Esto permitirá en el visor de esa ventana validar los datos de la planilla cargada, y utilizando las flechas del extremo superior derecho se podrá verificar que cada dato se encuentre en el campo que corresponda (de acuerdo al formato definido).</p><p><img src="/assets/img/docs/basic-rules/bid-upload.png" alt="Cargador de Archivo"></p><p>Al dar Ok, se procesará el archivo y quedará pendiente de importar (cargado en el sistema).</p><h3 id="_3-importar-contrato" tabindex="-1"><a class="header-anchor" href="#_3-importar-contrato" aria-hidden="true">#</a> 3. Importar Contrato</h3><p>Esta ventana nos permite visualizar el archivo previamente cargado (desde Cargador de Archivos). Para agilizar la consulta del registro, desde búsqueda avanzada es posible ubicarlo con el filtro Importado = NO.</p><p>Permite realizar una segunda validación de los datos respecto al campo donde están ubicados.</p><p>Luego desde el botón de procesos al hacer click en &quot;Importación de Contrato&quot; se generan en sistema todas las entidades de acuerdo a los datos extraidos del archivo cargado e importado.</p><p><img src="/assets/img/docs/basic-rules/bid-import1.png" alt="Importar Contrato"></p><h3 id="_4-consejos-utiles" tabindex="-1"><a class="header-anchor" href="#_4-consejos-utiles" aria-hidden="true">#</a> 4. Consejos útiles</h3><p>Es válido mencionar que si se importan los datos de un estudiante que ya existe en la base de datos, el registro no se procesará (no se importará) y se informará de esta situación en el campo &quot;Mensaje Error Importación&quot;.</p><p><img src="/assets/img/docs/basic-rules/bid-import-error-message.png" alt="Mensajes de Error"></p><p>A su vez, en el caso de importar una familia que ya exista en la base de datos, los registros de estudiante, responsable de pago y contrato se sumarán a esa familia previamente creada.</p><p>Esta función se habilitó a los fines de permitir sumar estudiantes (hermanos) o nuevos contactos a una familia previamente creada.</p><h3 id="_5-ejemplo-de-carga-de-archivo-alumno-contrato" tabindex="-1"><a class="header-anchor" href="#_5-ejemplo-de-carga-de-archivo-alumno-contrato" aria-hidden="true">#</a> 5. Ejemplo de Carga de Archivo Alumno-Contrato</h3><p><img src="/assets/img/docs/basic-rules/bid-import-upload.mp4" alt="Ejemplo Carga de Archivo"></p>',29)],i={},s=(0,o(75592).A)(i,[["render",function(a,e){return(0,r.uX)(),(0,r.CE)("div",null,t)}]])}}]);